import React from 'react';

const FromOrbit = (props) => {

    return (
        <div>
            <button
                // hasGround={props.hasGround}
                onClick={() => props.fromOrbitToSurface()}>
                land on ground
            </button>
            <button
                // isPlanet={props.hasChild}
                onClick={() => props.escapeFromOrbit()}>
                escape gravity
            </button>
            <button
                // hasChild={props.hasChild}
                onClick={() => props.childTransfer()}>
                tranfert to child
            </button>
            <button                
                //  hasParachute={props.hasParachute}
                onClick={() => props.commandModuleReEntry()}>
                Make a re-entry burn and land the capsule
            </button>

            <select>
                {props.celestBodiesList.map( (e, i) => {
                    return (
                    <div key={i}>
                        <option value={e} > {e.name} </option>
                        <button onClick={() => props.planetTransfert(e)}> tranfert</button>
                    </div>)
                })}
            </select>
        </div>
    );
};

export default FromOrbit;
